import React from 'react'
import ListBox from "../Components/ListBox";
import { GetPokemon } from "../Utils/ApiPokemons"

export default function index() {
    const data = [
        { title: "pokemon", game: "fire Red"},
        { title: "pokemon", game: "fire Red"},
        { title: "pokemon", game: "fire Red"},
    ];
    return (
        <div>
            <ListBox ListData={data} />
        </div>
    );
}
